const longestPalindrome = require("../../src/medium/Task5");

test("Get the longest palindromic substring in 'babad'", () => {
    expect(longestPalindrome("babad")).toBe("aba" || "bab");
});

test("Get the longest palindromic substring in 'cbbd'", () => {
    expect(longestPalindrome("cbbd")).toBe("bb");
});

test("Get the longest palindromic substring in 'a'", () => {
    expect(longestPalindrome("a")).toBe("a");
});

test("Get the longest palindromic substring in 'ac'", () => {
    expect(longestPalindrome("ac")).toBe("a");
});

test("Get the longest palindromic substring in 'bb'", () => {
    expect(longestPalindrome("bb")).toBe("bb");
});

test("Get the longest palindromic substring in 'ccc'", () => {
    expect(longestPalindrome("ccc")).toBe("ccc");
});

test("Get the longest palindromic substring in 'bananas'", () => {
    expect(longestPalindrome("bananas")).toBe("anana");
});

test("Get the longest palindromic substring in 'abcda'", () => {
    expect(longestPalindrome("abcda")).toBe("a");
});

test("Get the longest palindromic substring in ''", () => {
    expect(longestPalindrome("")).toBe("fklkf");
});
